      },
    },
  };
  const searchClient = createSearchClient();
  const search = instantsearch({
    indexName: 'my-index',
    searchClient,
    routing: {
      router: {
        onUpdate: () => {},
        read: () => {
          return currentRouteState.value;
        },
        write: () => {},
        createURL: () => '',
        dispose: () => {},
      },
    },
  });
  search.addWidgets([
    searchBox({ container: document.createElement('div') }),
  ]);
  search.start();
  await wait(0);
  expect(search.getUiState()).toMatchInlineSnapshot(`
