    searchBox({ container: document.createElement('div') }),
  ]);
  search.start();
  await wait(0);
  expect(search.getUiState()).toMatchInlineSnapshot(`
    {
      "my-index": {
        "query": "MacBook",
      },
    }
  `);
});

