test('denormalizes schema with extra members', () => {
  const entities = {
    Tacos: {
      1: { id: '1', type: 'foo' },
      2: { id: '2', type: 'bar' },
    },
  };
  expect(
    denormalize(
      {
        data: ['1', '2'],
        extra: '5',
        page: {
          first: null,
          second: { thing: 'two' },
          third: 1,
          complex: { complex: false, next: true },
        },
      },
      {
        data: [Tacos],
        extra: '',
        page: {
          first: null,
          second: undefined,
          third: 0,
          complex: { complex: true, next: false },
        },
      },
      entities,
    ),
  ).toMatchSnapshot();
});

test('can use a custom merging strategy', () => {
  class MergeTaco extends Tacos {
    static merge<T extends typeof Entity>(
      this: T,
      existing: AbstractInstanceType<T>,
      incoming: AbstractInstanceType<T>,
    ) {
      const props = Object.assign({}, existing, incoming, {
        name: (existing as MergeTaco).name,
      });
      return this.fromJS(props);
    }
  }

  expect(
    normalize(
      [
        { id: '1', name: 'foo' },
        { id: '1', name: 'bar', alias: 'bar' },
      ],
      [MergeTaco],
    ),
  ).toMatchSnapshot();
});

it('should handle optional schema entries Entity', () => {
  class MyEntity extends Entity {
    readonly name: string = '';
    readonly secondthing: string = '';
    readonly blarb: Date | undefined = undefined;
    pk() {
      return this.name;
    }

    static schema = {
      blarb: Date,
    };
  }
  const schema = MyEntity;

  expect(
    denormalize('bob', schema, {
      MyEntity: { bob: { name: 'bob', secondthing: 'hi' } },
    }),
  ).toMatchInlineSnapshot(`
    Array [
      MyEntity {
        "blarb": undefined,
        "name": "bob",
        "secondthing": "hi",
      },
      true,
      false,
    ]
  `);
});

