it('emits status updates when node compatibility changes', () => {
  const nodeCompat$ = new Subject<NodesVersionCompatibility>();

  const statusUpdates: ServiceStatus[] = [];
  const subscription = calculateStatus$(nodeCompat$).subscribe((status) =>
    statusUpdates.push(status)
  );

  nodeCompat$.next({
    isCompatible: false,
    kibanaVersion: '2.1.1',
    incompatibleNodes: [],
    warningNodes: [],
    message: 'Unable to retrieve version info',
  });
  nodeCompat$.next({
    isCompatible: false,
    kibanaVersion: '2.1.1',
    incompatibleNodes: [nodeInfo],
    warningNodes: [],
    message: 'Incompatible with Elasticsearch',
  });
  nodeCompat$.next({
    isCompatible: true,
    kibanaVersion: '1.1.1',
    warningNodes: [nodeInfo],
    incompatibleNodes: [],
    message: 'Some nodes are incompatible',
  });
  nodeCompat$.next({
    isCompatible: true,
    kibanaVersion: '1.1.1',
    warningNodes: [],
    incompatibleNodes: [],
  });

  subscription.unsubscribe();
  expect(statusUpdates).toMatchInlineSnapshot(`
    Array [
      Object {
        "level": unavailable,
        "meta": Object {
          "incompatibleNodes": Array [],
          "warningNodes": Array [],
        },
        "summary": "Waiting for Elasticsearch",
      },
      Object {
        "level": critical,
        "meta": Object {
          "incompatibleNodes": Array [],
          "warningNodes": Array [],
        },
        "summary": "Unable to retrieve version info",
      },
      Object {
        "level": critical,
        "meta": Object {
          "incompatibleNodes": Array [
            Object {
              "http": Object {
                "publish_address": "https://1.1.1.1:9200",
              },
              "ip": "1.1.1.1",
              "name": "node1",
              "version": "1.1.1",
            },
          ],
          "warningNodes": Array [],
        },
        "summary": "Incompatible with Elasticsearch",
      },
      Object {
        "level": available,
        "meta": Object {
          "incompatibleNodes": Array [],
          "warningNodes": Array [
            Object {
              "http": Object {
                "publish_address": "https://1.1.1.1:9200",
              },
              "ip": "1.1.1.1",
              "name": "node1",
              "version": "1.1.1",
            },
          ],
        },
        "summary": "Some nodes are incompatible",
      },
      Object {
        "level": available,
        "meta": Object {
          "incompatibleNodes": Array [],
          "warningNodes": Array [],
